const initialState = {
  'all': true,
  '0': false,
  '1': true,
  '2': true,
  '3': true,
}

export const filterReducer = (state = initialState, action) => {
  switch (action.type) {
    case 'changeState':
      console.log(action);
      break;
    default:
      return state;
  }
}
